import React from 'react';
import './Home.css'
import Kaibot from '../Kaibot.png'
import { Link } from 'react-router-dom'

function Home() {
  return (
    <div className='home' onDragStart={event => event.preventDefault()}>
      <div className='btn-container'>
        <Link to={{
          pathname: 'https://discord.com/oauth2/authorize?client_id=775542914117795860&permissions=8&scope=bot'
        }} target='_blank'>
          <button className='invite'>
            초대하기
          </button>
        </Link>
        <Link to={{
          pathname: '/commands'
        }}>
          <button className='commands'>
            명령어
          </button>
        </Link>
      </div>
    </div>
  );
}

export default Home;
